import React, { Component } from 'react';

class App extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            songs: []
        }
    }

    componentDidMount(){
      fetch('http://localhost:5000/posts')
      .then(res => res.json())
      .then(songs => this.setState({songs}, () => console.log('songs fetched',songs)));
    }

    render() {
        return (
            <div className="App">
                <h1>This is a react app</h1>
                 <ul>
                     {this.state.songs.map(song =>
                         <li key={song.MusicID}>{song.SongName}</li>
                        )}
                 </ul>
            </div>
        );
    }
}

export default App;
